      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import { console } from "forge-std/console.sol";

import { ERC404 } from "./ERC404.sol";
import { Drawing } from "./Drawing.sol";

contract Henohenomoheji is ERC404, Drawing {
    constructor(address _owner) ERC404("Henohenomoheji", "HENO", 18, 10_000, _owner) {
        balanceOf[_owner] = 10_000 * 10 ** 18;
    }

    function setNameSymbol(string memory _name, string memory _symbol) public onlyOwner {
        _setNameSymbol(_name, _symbol);
    }

    function tokenURI(uint256 id) public view override returns (string memory) {
        string memory uri = draw(id);
        return uri;
    }
}
"
