    "src/ERC404.sol": {
      "content": "//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

abstract contract Ownable {
    event OwnershipTransferred(address indexed user, address indexed newOwner);

    error Unauthorized();
    error InvalidOwner();

    address public owner;

    modifier onlyOwner() virtual {
        if (msg.sender != owner) revert Unauthorized();

        _;
    }

    constructor(address _owner) {
        if (_owner == address(0)) revert InvalidOwner();

        owner = _owner;

        emit OwnershipTransferred(address(0), _owner);
    }

    function transferOwnership(address _owner) public virtual onlyOwner {
        if (_owner == address(0)) revert InvalidOwner();

        owner = _owner;

        emit OwnershipTransferred(msg.sender, _owner);
    }

    function revokeOwnership() public virtual onlyOwner {
        owner = address(0);

        emit OwnershipTransferred(msg.sender, address(0));
    }
}

abstract contract ERC721Receiver {
    function onERC721Received(address, address, uint256, bytes calldata) external virtual returns (bytes4) {
        return ERC721Receiver.onERC721Received.selector;
    }
}

/// @notice ERC404
///         A gas-efficient, mixed ERC20 / ERC721 implementation
///         with native liquidity and fractionalization.
///
///         This is an experimental standard designed to integrate
///         with pre-existing ERC20 / ERC721 support as smoothly as
///         possible.
///
/// @dev    In order to support full functionality of ERC20 and ERC721
///         supply assumptions are made that slightly constraint usage.
///         Ensure decimals are sufficiently large (standard 18 recommended)
///         as ids are effectively encoded in the lowest range of amounts.
///
///         NFTs are spent on ERC20 functions in a FILO queue, this is by
///         design.
///
abstract contract ERC404 is Ownable {
    // Events
    event ERC20Transfer(address indexed from, address indexed to, uint256 amount);
    event Approval(address indexed owner, address indexed spender, uint256 amount);
    event Transfer(address indexed from, address indexed to, uint256 indexed id);
    event ERC721Approval(address indexed owner, address indexed spender, uint256 indexed id);
    event ApprovalForAll(address indexed owner, address indexed operator, bool approved);

    // Errors
    error NotFound();
    error AlreadyExists();
    error InvalidRecipient();
    error InvalidSender();
    error UnsafeRecipient();

    // Metadata
    /// @dev Token name
    string public name;

    /// @dev Token symbol
    string public symbol;

    /// @dev Decimals for fractional representation
    uint8 public immutable decimals;

    /// @dev Total supply in fractionalized representation
    uint256 public immutable totalSupply;

    /// @dev Current mint counter, monotonically increasing to ensure accurate ownership
    uint256 public minted;

    // Mappings
    /// @dev Balance of user in fractional representation
    mapping(address => uint256) public balanceOf;

    /// @dev Allowance of user in fractional representation
    mapping(address => mapping(address => uint256)) public allowance;

    /// @dev Approval in native representaion
    mapping(uint256 => address) public getApproved;

    /// @dev Approval for all in native representation
    mapping(address => mapping(address => bool)) public isApprovedForAll;

    /// @dev Owner of id in native representation
    mapping(uint256 => address) internal _ownerOf;

    /// @dev Array of owned ids in native representation
    mapping(address => uint256[]) internal _owned;

    /// @dev Tracks indices for the _owned mapping
    mapping(uint256 => uint256) internal _ownedIndex;

    /// @dev Addresses whitelisted from minting / burning for gas savings (pairs, routers, etc)
    mapping(address => bool) public whitelist;

    // Constructor
    constructor(
        string memory _name,
        string memory _symbol,
        uint8 _decimals,
        uint256 _totalNativeSupply,
        address _owner
    )
        Ownable(_owner)
    {
        name = _name;
        symbol = _symbol;
        decimals = _decimals;
        totalSupply = _totalNativeSupply * (10 ** decimals);
    }

    /// @notice Initialization function to set pairs / etc
    ///         saving gas by avoiding mint / burn on unnecessary targets
    function setWhitelist(address target, bool state) public onlyOwner {
        whitelist[target] = state;
    }

    /// @notice Function to find owner of a given native token
    function ownerOf(uint256 id) public view virtual returns (address owner) {
        owner = _ownerOf[id];

        if (owner == address(0)) {
            revert NotFound();
        }
    }

    /// @notice tokenURI must be implemented by child contract
    function tokenURI(uint256 id) public view virtual returns (string memory);

    /// @notice Function for token approvals
    /// @dev This function assumes id / native if amount less than or equal to current max id
    function approve(address spender, uint256 amountOrId) public virtual returns (bool) {
        if (amountOrId <= minted && amountOrId > 0) {
            address owner = _ownerOf[amountOrId];

            if (msg.sender != owner && !isApprovedForAll[owner][msg.sender]) {
                revert Unauthorized();
            }

            getApproved[amountOrId] = spender;

            emit Approval(owner, spender, amountOrId);
        } else {
            allowance[msg.sender][spender] = amountOrId;

            emit Approval(msg.sender, spender, amountOrId);
        }

        return true;
    }

    /// @notice Function native approvals
    function setApprovalForAll(address operator, bool approved) public virtual {
        isApprovedForAll[msg.sender][operator] = approved;

        emit ApprovalForAll(msg.sender, operator, approved);
    }

    /// @notice Function for mixed transfers
    /// @dev This function assumes id / native if amount less than or equal to current max id
    function transferFrom(address from, address to, uint256 amountOrId) public virtual {
        if (amountOrId <= minted) {
            if (from != _ownerOf[amountOrId]) {
                revert InvalidSender();
            }

            if (to == address(0)) {
                revert InvalidRecipient();
            }

            if (msg.sender != from && !isApprovedForAll[from][msg.sender] && msg.sender != getApproved[amountOrId]) {
                revert Unauthorized();
            }

            balanceOf[from] -= _getUnit();

            unchecked {
                balanceOf[to] += _getUnit();
            }

            _ownerOf[amountOrId] = to;
            delete getApproved[amountOrId];

            // update _owned for sender
            uint256 updatedId = _owned[from][_owned[from].length - 1];
            _owned[from][_ownedIndex[amountOrId]] = updatedId;
            // pop
            _owned[from].pop();
            // update index for the moved id
            _ownedIndex[updatedId] = _ownedIndex[amountOrId];
            // push token to to owned
            _owned[to].push(amountOrId);
            // update index for to owned
            _ownedIndex[amountOrId] = _owned[to].length - 1;

            emit Transfer(from, to, amountOrId);
            emit ERC20Transfer(from, to, _getUnit());
        } else {
            uint256 allowed = allowance[from][msg.sender];

            if (allowed != type(uint256).max) {
                allowance[from][msg.sender] = allowed - amountOrId;
            }

            _transfer(from, to, amountOrId);
        }
    }

    /// @notice Function for fractional transfers
    function transfer(address to, uint256 amount) public virtual returns (bool) {
        return _transfer(msg.sender, to, amount);
    }

    /// @notice Function for native transfers with contract support
    function safeTransferFrom(address from, address to, uint256 id) public virtual {
        transferFrom(from, to, id);

        if (
            to.code.length != 0
                && ERC721Receiver(to).onERC721Received(msg.sender, from, id, "") != ERC721Receiver.onERC721Received.selector
        ) {
            revert UnsafeRecipient();
        }
    }

    /// @notice Function for native transfers with contract support and callback data
    function safeTransferFrom(address from, address to, uint256 id, bytes calldata data) public virtual {
        transferFrom(from, to, id);

        if (
            to.code.length != 0
                && ERC721Receiver(to).onERC721Received(msg.sender, from, id, data)
                    != ERC721Receiver.onERC721Received.selector
        ) {
            revert UnsafeRecipient();
        }
    }

    /// @notice Internal function for fractional transfers
    function _transfer(address from, address to, uint256 amount) internal returns (bool) {
        uint256 unit = _getUnit();
        uint256 balanceBeforeSender = balanceOf[from];
        uint256 balanceBeforeReceiver = balanceOf[to];

        balanceOf[from] -= amount;

        unchecked {
            balanceOf[to] += amount;
        }

        // Skip burn for certain addresses to save gas
        if (!whitelist[from]) {
            uint256 tokens_to_burn = (balanceBeforeSender / unit) - (balanceOf[from] / unit);
            for (uint256 i = 0; i < tokens_to_burn; i++) {
                _burn(from);
            }
        }

        // Skip minting for certain addresses to save gas
        if (!whitelist[to]) {
            uint256 tokens_to_mint = (balanceOf[to] / unit) - (balanceBeforeReceiver / unit);
            for (uint256 i = 0; i < tokens_to_mint; i++) {
                _mint(to);
            }
        }

        emit ERC20Transfer(from, to, amount);
        return true;
    }

    // Internal utility logic
    function _getUnit() internal view returns (uint256) {
        return 10 ** decimals;
    }

    function _mint(address to) internal virtual {
        if (to == address(0)) {
            revert InvalidRecipient();
        }

        unchecked {
            minted++;
        }

        uint256 id = minted;

        if (_ownerOf[id] != address(0)) {
            revert AlreadyExists();
        }

        _ownerOf[id] = to;
        _owned[to].push(id);
        _ownedIndex[id] = _owned[to].length - 1;

        emit Transfer(address(0), to, id);
    }

    function _burn(address from) internal virtual {
        if (from == address(0)) {
            revert InvalidSender();
        }

        uint256 id = _owned[from][_owned[from].length - 1];
        _owned[from].pop();
        delete _ownedIndex[id];
        delete _ownerOf[id];
        delete getApproved[id];

        emit Transfer(from, address(0), id);
    }

    function _setNameSymbol(string memory _name, string memory _symbol) internal {
        name = _name;
        symbol = _symbol;
    }
}
"
    },
    "src/Drawing.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import { strings } from "../lib/solidity-stringutils/src/strings.sol"; // https://github.com/Arachnid/solidity-stringutils

contract Drawing {
    using strings for *;

    function random(string memory input) internal pure returns (uint256) {
        return uint256(keccak256(abi.encodePacked(input)));
    }

    function toString(uint256 value) internal pure returns (string memory) {
        // Inspired by OraclizeAPI's implementation - MIT license
        // https://github.com/oraclize/ethereum-api/blob/b42146b063c7d6ee1358846c198246239e9360e8/oraclizeAPI_0.4.25.sol

        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }

    function pluck(
        uint256 tokenId,
        string memory component,
        strings.slice[] memory sourceArray
    )
        internal
        pure
        returns (strings.slice memory)
    {
        uint256 rand = random(string(abi.encodePacked(component, toString(tokenId))));
        strings.slice memory output = sourceArray[rand % sourceArray.length];
        return output;
    }

    function face(uint256 tokenId) internal pure returns (strings.slice memory) {
        strings.slice[2] memory faces = [
            // じ
            unicode"<g transform='translate(-3000, 7000)'> <text  x='1' y='1' transform='scale(900, 700)'  font-size='smaller' fill='orange' font-weight='lighter' stroke='#FFFFFF' stroke-width='0.2'>じ</text></g>"
                .toSlice(),
            // し
            unicode"<text  x='1' y='11' transform='scale(10, 700)' textLength='1000'  lengthAdjust='spacingAndGlyphs' font-size='smaller' fill='purple' font-weight='lighter'>し</text>"
                .toSlice()
        ];
        uint256 rand = random(string(abi.encodePacked("face", toString(tokenId))));
        strings.slice memory output = faces[rand % faces.length];
        return output;
    }

    function eyebrows(uint256 tokenId) internal pure returns (strings.slice memory) {
        strings.slice[2] memory eyebrowses = [unicode"へ".toSlice(), unicode"へへ".toSlice()];

        uint256 rand = random(string(abi.encodePacked("eyebrows", toString(tokenId))));
        strings.slice memory output = eyebrowses[rand % eyebrowses.length];
        return output;
    }

    function eyes(uint256 tokenId) internal pure returns (strings.slice memory) {
        strings.slice[14] memory eyeses = [
            unicode"あ".toSlice(),
            unicode"め".toSlice(),
            unicode"ぬ".toSlice(),
            unicode"る".toSlice(),
            unicode"へ".toSlice(),
            unicode"み".toSlice(),
            unicode"ゐ".toSlice(),
            unicode"べ".toSlice(),
            unicode"ぺ".toSlice(),
            unicode"お".toSlice(),
            unicode"の".toSlice(),
            unicode"𛄄".toSlice(),
            unicode"𛃗".toSlice(),
            unicode"𛃥".toSlice()
        ];
        uint256 rand = random(string(abi.encodePacked("eyeses", toString(tokenId))));
        strings.slice memory output = eyeses[rand % eyeses.length];
        return output;
    }

    function nose(uint256 tokenId) internal pure returns (strings.slice memory) {
        strings.slice[21] memory noses = [
            unicode"も".toSlice(),
            unicode"く".toSlice(),
            unicode"い".toSlice(),
            unicode"て".toSlice(),
            unicode"で".toSlice(),
            unicode"ぐ".toSlice(),
            unicode"と".toSlice(),
            unicode"ど".toSlice(),
            unicode"ん".toSlice(),
            unicode"む".toSlice(),
            unicode"り".toSlice(),
            unicode"を".toSlice(),
            unicode"け".toSlice(),
            unicode"げ".toSlice(),
            unicode"に".toSlice(),
            unicode"𬼂".toSlice(),
            unicode"ふ".toSlice(),
            unicode"ぷ".toSlice(),
            unicode"𛃫".toSlice(),
            unicode"𛂍".toSlice(),
            unicode"𛂪".toSlice()
        ];
        uint256 rand = random(string(abi.encodePacked("nose", toString(tokenId))));
        strings.slice memory output = noses[rand % noses.length];
        return output;
    }

    function mouth(uint256 tokenId) internal pure returns (strings.slice memory) {
        strings.slice[22] memory mouths = [
            unicode"𛁠".toSlice(),
            unicode"へ".toSlice(),
            unicode"こ".toSlice(),
            unicode"ひ".toSlice(),
            unicode"み".toSlice(),
            unicode"し".toSlice(),
            unicode"𛂹".toSlice(),
            unicode"う".toSlice(),
            unicode"ゑ".toSlice(),
            unicode"そ".toSlice(),
            unicode"つ".toSlice(),
            unicode"ツ".toSlice(),
            unicode"シ".toSlice(),
            unicode"𬻿".toSlice(),
            unicode"𬼀".toSlice(),
            unicode"ソ".toSlice(),
            unicode"ン".toSlice(),
            unicode"ゝ".toSlice(),
            unicode"〻".toSlice(),
            unicode"こ".toSlice(),
            unicode"𛀅".toSlice(),
            unicode"𛀙".toSlice()
        ];
        uint256 rand = random(string(abi.encodePacked("mouth", toString(tokenId))));
        strings.slice memory output = mouths[rand % mouths.length];
        return output;
    }

    function ear(uint256 tokenId) internal pure returns (strings.slice memory) {
        strings.slice[8] memory ears = [
            unicode"る".toSlice(),
            unicode"ろ".toSlice(),
            unicode"う".toSlice(),
            unicode"𛀚".toSlice(),
            unicode"ゟ".toSlice(),
            unicode"〻".toSlice(),
            unicode"𛃂".toSlice(),
            unicode"𛃻".toSlice()
        ];
        uint256 rand = random(string(abi.encodePacked("ear", toString(tokenId))));
        strings.slice memory output = ears[rand % ears.length];
        return output;
    }

    function backgroundColour(uint256 tokenId) internal pure returns (strings.slice memory) {
        strings.slice[8] memory backgroundColours = [
            unicode"#FFFFE0".toSlice(),
            unicode"#F0F8FF".toSlice(),
            unicode"#CAFFE8".toSlice(),
            unicode"#FFE2FE".toSlice(),
            unicode"#DFE1FF".toSlice(),
            unicode"#F3FFDF".toSlice(),
            unicode"#FFE6A9".toSlice(),
            unicode"#FFE0DF".toSlice()
        ];
        uint256 rand = random(string(abi.encodePacked("backgroundColours", toString(tokenId))));
        strings.slice memory output = backgroundColours[rand % backgroundColours.length];
        return output;
    }

    function makeFaceString(
        strings.slice memory _face,
        strings.slice memory _background_colour
    )
        internal
        pure
        returns (strings.slice memory _faceString, bool shi)
    {
        if (_face.equals(unicode"し".toSlice())) {
            return (
                // faceshi し
                (
                    (
                        (
                            (
                                unicode"<g transform='translate(-2200, 7000)'><text  x='1' y='1' transform='scale(900, 700)'  font-size='smaller' fill='black' font-weight='lighter' stroke='"
                                    .toSlice()
                            )
                        ).concat(_background_colour).toSlice()
                    ).concat((unicode"' stroke-width='0.5'>し</text></g>".toSlice())).toSlice()
                    ),
                true
            );
        } else {
            return (
                // faceji じ
                (
                    (
                        (
                            (
                                unicode"<g transform='translate(-3267, 7000)'><text  x='1' y='1' transform='scale(930, 700)' font-size='smaller' fill='black' font-weight='lighter' stroke='"
                                    .toSlice()
                            ).concat(_background_colour).toSlice()
                        ).concat(unicode"' stroke-width='0.5'>じ</text></g>".toSlice())
                    ).toSlice()
                    ),
                false
            );
        }
    }

    function makeEarString(strings.slice memory _ear) internal pure returns (strings.slice memory _earString) {
        return (
            (
                (
                    (
                        unicode"<g transform='translate(6700, 4600)'><text  x='1' y='1'  transform='scale(180)' lengthAdjust='spacingAndGlyphs' font-size='smaller' fill='black' font-weight='lighter'>"
                            .toSlice()
                    ).concat(_ear).toSlice()
                ).concat(unicode"</text></g>".toSlice())
            ).toSlice()
        );
    }

    function makeEyebrowsString(strings.slice memory _eyebrows)
        internal
        pure
        returns (strings.slice memory _eyebrowsString)
    {
        if (_eyebrows.equals(unicode"へ".toSlice())) {
            return (
                unicode"<g transform='translate(1200, 3000)'><text  x='2' y='0'  transform='translate(1000, -200) scale(170)' textLength='2.5em' lengthAdjust='spacingAndGlyphs' font-size='smaller' fill='black' font-weight='lighter'>へ</text></g>"
                    .toSlice()
            );
        } else {
            return (
                unicode"<g transform='translate(2400, 2800)'><text  x='1' y='1'  transform='scale(200)' lengthAdjust='spacingAndGlyphs' font-size='smaller' fill='black' font-weight='lighter'>へ</text></g><g transform='translate(4800, 2800)'>    <text  x='1' y='1'  transform='scale(200)' lengthAdjust='spacingAndGlyphs' font-size='smaller' fill='black' font-weight='lighter'>へ</text></g>"
                    .toSlice()
            );
        }
    }

    function makeEyesString(strings.slice memory _eyes) internal pure returns (strings.slice memory _eyesString) {
        return (
            (
                (
                    (
                        (
                            unicode"<g transform='translate(2900, 3620)'><text  x='1' y='1'  transform='scale(120)' lengthAdjust='spacingAndGlyphs' font-size='smaller' fill='black' font-weight='lighter'>"
                                .toSlice()
                        ).concat(_eyes).toSlice()
                    ).concat(unicode"</text></g>".toSlice()).toSlice()
                ).concat(
                    (
                        (
                            unicode"<g transform='translate(5300, 3620)'><text  x='1' y='1'  transform='scale(120)' lengthAdjust='spacingAndGlyphs' font-size='smaller' fill='black' font-weight='lighter'>"
                                .toSlice()
                        ).concat(_eyes).toSlice()
                    ).concat(unicode"</text></g>".toSlice()).toSlice()
                )
            ).toSlice()
        );
    }

    function makeNoseString(strings.slice memory _nose) internal pure returns (strings.slice memory _noseString) {
        return (
            (
                (
                    (
                        unicode"<g transform='translate(4000, 5000)'><text  x='1' y='1'  transform='scale(120)' lengthAdjust='spacingAndGlyphs' font-size='smaller' fill='black' font-weight='lighter'>"
                            .toSlice()
                    ).concat(_nose)
                ).toSlice()
            ).concat(unicode"</text></g>".toSlice()).toSlice()
        );
    }

    function makeMouthString(strings.slice memory _mouth) internal pure returns (strings.slice memory _mouthString) {
        return (
            (
                (
                    (
                        unicode"<g transform='translate(4000, 7000)'><text  x='1' y='1'  transform='scale(120)' lengthAdjust='spacingAndGlyphs' font-size='smaller' fill='black' font-weight='lighter'>"
                            .toSlice()
                    ).concat(_mouth).toSlice()
                ).concat(unicode"</text></g>".toSlice())
            ).toSlice()
        );
    }

    function makeBasicFaceString(
        strings.slice memory _earsString,
        strings.slice memory _eyebrowsString,
        strings.slice memory _eyesString,
        strings.slice memory _noseString,
        strings.slice memory _mouthString
    )
        internal
        pure
        returns (strings.slice memory _basicFaceString)
    {
        return (
            (
                (((_earsString).concat(_eyebrowsString)).toSlice()).concat(
                    ((((_eyesString).concat(_noseString)).toSlice()).concat(_mouthString)).toSlice()
                )
            ).toSlice()
        );
    }

    function makeCompleteFace(
        strings.slice memory _face,
        strings.slice memory _background_colour,
        strings.slice memory _basicFaceString
    )
        internal
        pure
        returns (strings.slice memory completeFace)
    {
        (strings.slice memory _faceString, bool shi) = makeFaceString(_face, _background_colour);

        if (shi) {
            // faceshi し
            return ((_faceString.concat(_basicFaceString)).toSlice());
        } else {
            // faceji じ
            return (
                (
                    (
                        (
                            (
                                (
                                    _faceString.concat(
                                        (unicode"<g  transform='translate(500, 1500) scale(0.83)'>".toSlice())
                                    )
                                ).toSlice()
                            ).concat(_basicFaceString)
                        ).toSlice()
                    ).concat(unicode"</g>".toSlice())
                ).toSlice()
            );
        }
    }

    function wrapCanvas(
        strings.slice memory _stuff_inside,
        strings.slice memory _background_colour
    )
        internal
        pure
        returns (strings.slice memory drawing)
    {
        strings.slice memory head = (
            (
                (
                    (
                        (
                            unicode"<svg  xmlns='http://www.w3.org/2000/svg' width='10000' height='10000' style='background-color:"
                                .toSlice()
                        )
                    ).concat(_background_colour)
                ).toSlice()
            ).concat(unicode"'>".toSlice()).toSlice()
        );

        strings.slice memory tail = unicode"</svg>".toSlice();

        return (head.concat((_stuff_inside.concat(tail)).toSlice())).toSlice();
    }

    function draw(uint256 tokenId) public view returns (string memory) {
        strings.slice memory _face = face(tokenId);
        strings.slice memory _ear = ear(tokenId);
        strings.slice memory _eyebrows = eyebrows(tokenId);
        strings.slice memory _eyes = eyes(tokenId);
        strings.slice memory _nose = nose(tokenId);
        strings.slice memory _mouth = mouth(tokenId);
        strings.slice memory _background_colour = backgroundColour(tokenId);
        strings.slice memory _basicFaceString = makeBasicFaceString(
            makeEarString(_ear),
            makeEyebrowsString(_eyebrows),
            makeEyesString(_eyes),
            makeNoseString(_nose),
            makeMouthString(_mouth)
        );
        strings.slice memory completeFace = makeCompleteFace(_face, _background_colour, _basicFaceString);
        strings.slice memory drawing = wrapCanvas(completeFace, _background_colour);
        return drawing.toString();
    }
}
